What type of content worked best in your case?
> On the quality of the content, a lot of that is listening to readers and tracking how our stuff is doing to see what people like. There is definitely content that is more likely go to viral than others, so optimizing your stuff based on what your readers like is a great way to increase your odds, does that make sense?
@Mx

@adomas we did two big things: 

1. There are a bunch of "platforms" that let you search influencers and are supposed to match brands with content creators. I signed up for Sales Demos for all of them and took notes on the people I saw 

2. I did a giveaway on reddit to celebrate our one year anniversary. In the giveaway I asked everyone to link their favorite YouTuber about games to enter, then I went through the list and emailed the people I thought would work best. The giveaway also got us some subscriptions, which was cool
